function parseData() {
    var rawData = Script.Inputs.KpiData
    var kpiData = []
    for (const site in rawData){
        temp = {};
        for (const kpi in rawData[site]){
            temp[kpi] = rawData[site][kpi]
        }
    kpiData.push(temp)
    }

    var rMap = {"unknown": 3, "sw_ev_ct": 1, "availability":3, "a_jitter_mean":0, "c_jitter_mean":0, "ttl_trf_ct_mb":0,
            "v_jitter_mean":0, "a_latency_mean":0, "c_availability":3, "c_latency_mean":0, "v_availability":3, "v_latency_mean":0,
            "a_sla_pass_mean":3, "c_sla_pass_mean":3, "v_sla_pass_mean":3}

    var sMap = {"unknown":" %", "availability":" %", "c_jitter_mean":" ms", "v_jitter_mean":" ms", "c_availability":" %",
            "c_latency_mean":" ms", "v_availability":" %", "v_latency_mean":" ms", "a_sla_pass_mean":" %", "c_sla_pass_mean":" %", "v_sla_pass_mean":" %"}


    // Handle Negative or Null Values
    for (const site in kpiData){
        for(val in kpiData[site]){
            if (kpiData[site][val] == null || kpiData[site][val] < 0){kpiData[site][val] = "No Data"}
        }
    };

    // Handle Rounding
    for (const site in kpiData){
      for (const val in kpiData[site]){
        if(rMap[val] != null && typeof(kpiData[site][val]) === "number"){(kpiData[site][val] = (kpiData[site][val].toFixed(rMap[val])))};
        if(sMap[val] != null && typeof(kpiData[site][val]) === "string" && kpiData[site][val] != 'No Data'){kpiData[site][val] = kpiData[site][val] + sMap[val]}
    }};

    // Handle Data Rate
    for (const site in kpiData){
        for (const val in kpiData[site]){
            var test = kpiData[site][val]
            if(val == "ttl_trf_ct_mb" && kpiData[site][val] > 1000 ){kpiData[site][val] = (Number(kpiData[site][val]) / 1000).toFixed(1) + " GB"};
            if(val == "ttl_trf_ct_mb" && kpiData[site][val] <= 1000){kpiData[site][val] = (Number(kpiData[site][val])).toFixed(0) + " MB"};
    }};
    // Check for Missing Fields
    var fieldList = ["site_id", "common_name", "availability", "v_availability", "c_availability", "v_sla_pass_mean", "c_sla_pass_mean",
                    "a_sla_pass_mean", "v_latency_mean", "c_latency_mean", "a_latency_mean", "v_jitter_mean", "c_jitter_mean", "a_jitter_mean", 
                    "sw_ev_ct", "ttl_trf_ct_mb", "unknown"]

    for (const field in fieldList){
        for(const site in kpiData){
            if(!(fieldList[field] in kpiData[site])){kpiData[site][fieldList[field]] = "No Data"}
        };
    };
    Script.Outputs.DataOutputString = kpiData
};


