// FOR EACH SITE, iterate through the headers and put the correct KPI datas into a single {} per site.
function onChange() {
    var count = 0
    var headers = Script.Inputs.Headers
    var items = Script.Inputs.Items
    var kpiArray = []
    for (const k in items){
        siteId = items[k].site_id
        var tempObject = {};
        count = count + 1
        tempObject['id'] = count
        tempObject['columns'] = []
        for (const h in headers){

            // if site_id column, add the path real time data so we can create alert icons. ELse push normal column data.
            if (headers[h].Field == "site_id") {
                tempObject['columns'].push({'value': items[k][headers[h].Field], 
                'field': headers[h].Field, 
                'label': headers[h].Label, 
                'site_id': siteId,
                'path_data': items[k]['path_data'],
                'tickets': items[k]['tickets']})
            }
            else{tempObject['columns'].push({'value': items[k][headers[h].Field], 'field': headers[h].Field, 'label': headers[h].Label, 'site_id': siteId})}
        };


        kpiArray.push(tempObject)
    };
    Script.Outputs.ItemOut = kpiArray;
    Script.Outputs.OutputHeader = Script.Inputs.Headers
};


Script.Setters.Items = onChange;
